import sqlite3
import hashlib

conn = sqlite3.connect('productos.db')
c = conn.cursor()
hash_md5 = hashlib.md5()

imagen = """

"""
extension = "jpg"

for i in range(0, 100):
    # Generamos la cadena a hashear:
    cadena = f"Producto {i+1}Descripción {i+1}"
    # Actualizamos el objeto hash con los strings
    hash_md5.update(cadena.encode('utf-8'))
    # Obtenemos el hash md5 como string hexadecimal
    hash = hash_md5.hexdigest()
    producto =  {
        "nombre":f'Producto {i+1}',
        "descripcion":f'Descripción {i+1}',
        "imagen": imagen,
        "extension": extension,
        "precio": 15,
        "existencia": i,
        "hash": hash
    }
    c.execute(f"INSERT INTO productos (nombre, descripcion, imagen, extension, precio, existencias, hash) VALUES ('{producto['nombre']}', '{producto['descripcion']}', '{producto['imagen']}', '{producto['extension']}', {producto['precio']}, {producto['existencia']}, '{producto['hash']}')")

# Guardar cambios y cerrar conexión
conn.commit()
conn.close()


print("Se han insertado 100 datos en la base de datos.")